func TestE(t *testing.T) {
	var e eState

	for i, vec := range eVectors {
		vecK, err := hex.DecodeString(vec.k)
		if err != nil {
			t.Fatal(err)
		}
		vecSrc, err := hex.DecodeString(vec.src)
		if err != nil {
			t.Fatal(err)
		}
		vecDst, err := hex.DecodeString(vec.dst)
		if err != nil {
			t.Fatal(err)
		}

		var vSrc, dst [blockSize]byte
		copy(vSrc[:], vecSrc)

		e.init(vecK)
		e.E(vec.j, vec.i, &vSrc, dst[:])
		assertEqual(t, i, vecDst, dst[:])
	}
}

